  description: |
    The Pachyderm operator aims to make deploying and managing Pachyderm instances on Openshift container platform easier.

    Pachyderm is an enterprise-grade, open-source data science platform that makes explainable, repeatable, and scalable AI/ML a reality.  It brings together version control for data with the tools to build scalable end-to-end AI/ML pipelines while empowering users to use any language, framework, or tool they want.

    ## Getting started

    1. Identify and set the pachd storage backend at `pachyderm.spec.pachd.storage.backend`. Supported backends are `AMAZON`, `MICROSOFT`, `GOOGLE` and `MINIO`.

    2. Setup the pachd storage credentials in the section, `pachyderm.spec.pachd.storage`. Required fields depend on the backend type set in step 1 above.

    3. Finally, deploy the pachyderm cluster.

    For more information on getting started, reference the documentation.
